import Book from "./Book";

const BooksGrid = ({ books, onBookshelfUpdate }) => {
  return (
    <ol className="books-grid">
      {
        books.map((book) => {
          return (
            <div key={book.id}>
              <Book
                book={book}
                onBookshelfUpdate={(book) => onBookshelfUpdate(book)}
              />
            </div>
          );
        })}
    </ol>
  );
};

export default BooksGrid;
